import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To reveal the view mode controls, we first need to navigate to a category page.
    // Click on the "Electronics" category card.
    await page.locator('.category-card').filter({ hasText: 'Electronics' }).click();

    // Wait for the sort and filter controls to be visible
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Take a screenshot of the default grid view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_grid_view.png'));

    // Locate and click the "List View" button
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.click();

    // Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take a final screenshot showing the list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Verify that the list view is active by checking the container's class
    const isListViewActive = await page.locator('.products-list').isVisible();

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        isListViewActive: isListViewActive,
        listViewButtonClass: await listViewButton.getAttribute('class')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
